import { useSelector, useDispatch } from "react-redux";
import {filterBySource} from "../../redux/actions";
import style from "./Filter.module.css"

const Filter = () => {

    //const allPokemons = useSelector((state) => state.allPokemons);
    const dispatch = useDispatch();

    const handlerFilterBySource = (event) => {
        dispatch(filterBySource(event.target.value));
    };

    return(
        <div className={style.FilterContainer}>
            <p className={style.LabelFilter}>Filter by</p>
            <select onChange={handlerFilterBySource} className={style.SelectorFilter}>
                <option key={0} value="title" disabled selected> </option>  
                <optgroup key={1} label="Source" font-weight="bold" disabled selected />  
                <option key={2} value="asc"></option>
                <option key={3} value="asc"></option>
                <optgroup key={4} label="Type" font-weight="bold" disabled selected />
                <option key={5} value="all"></option>  
                <option key={6} value="normal"></option>  
                <option key={7} value="fighting"></option>  
                <option key={8} value="flying"></option>  
                <option key={9} value="poison"></option>  
                <option key={10} value="ground"></option>  
                <option key={11} value="rock"></option>  
                <option key={12} value="bug"></option>  
                <option key={13} value="ghost"></option>  
                <option key={14} value="steel"></option>  
                <option key={15} value="fire"></option>  
                <option key={16} value="water"></option>  
                <option key={17} value="grass"></option>  
                <option key={18} value="electric"></option>  
                <option key={19} value="psychic"></option>  
                <option key={20} value="ice"></option>  
                <option key={21} value="dragon"></option>  
                <option key={22} value="dark"></option>  
                <option key={23} value="fairy"></option>  
                <option key={24} value="unknown"></option>  
                <option key={25} value="shadow"></option>  
            </select>
        </div>
    )
}

export default Filter;
